;; **
;;; Define parameters and train the neural network.
;; **

;; @@
(def hidden-layers [60 30])
(def alpha 0.3)
(def partitions 10)
(def iterations 20)

(defn train-neural-network
  [model data k]
  (let [validation (random-sample data 100)]
    (loop [partitions (partition (/ (count data) k) data)
           model model]
      (when (not (nil? (:parameters model)))
        (println "partition" (- k (count partitions)) (neural-network-cost model validation)))
      (if (empty? partitions)
        model
        (recur (rest partitions)
               (neural-network-fit model (first partitions)))))))

(def validation (random-sample train-data 2000))

(def nn
  (loop [iter 0
         model (nnv/make-neural-network hidden-layers alpha)]
    (if (>= iter iterations)
      model
      (do
        (println "iteration" iter "accuracy" (accuracy model validation))
        (recur (inc iter)
               (train-neural-network model train-data partitions))))))

(println "final accuracy" (accuracy nn validation))
